css:
@-moz-document domain("sailsjs.com") {
body {
    background: #222222;
}

h1, h2, h3, h4, h5, p {
    color: #ffffff !important;
}

.side-nav {
    background-color: #333333 !important;
    color: #eeeeee;
    padding-left: 4px;
}
.side-nav a {
    color: #ffffff !important;
}
.side-nav li {    
    padding-left: 5px !important;
}


.ad {
    display: none !important;
}

code {
    background-color: #333333 !important;
}
.nav-container {
     background-color: #111111;
}

table, td, span, .xml {
    color: #eeeeee !important;
}
}
